"""re methods"""

import re

re.match(pattern="h", string="hello") # Matches "h"
re.match(pattern="o", string="hello") # No match
re.match(pattern=".*o", string="hello") # Matches "hello"
re.match(pattern="h.*", string="hello") # Matches "hello"

re.fullmatch(pattern="h", string="hello") # No match
re.fullmatch(pattern="o", string="hello") # No match
re.fullmatch(pattern=".*o", string="hello") # Matches "hello"
re.fullmatch(pattern="h.*", string="hello") # Matches "hello"


re.search(pattern="h", string="hello") # Finds "h"
re.search(pattern="o", string="hello") # Finds "o"
re.search(pattern=".*o", string="hello") # Finds "hello"
re.search(pattern="h.*", string="hello") # Finds "hello"


re.sub(pattern="h", repl="-", string="hello") # Returns "-ello"
re.sub(pattern="o", repl="-", string="hello") # Returns "hell-"
re.sub(pattern=".*o", repl="-", string="hello") # Returns "-"
re.sub(pattern="h.*", repl="-", string="hello") # Returns "-"


re.findall(pattern="h", string="hello") # Finds "h": ['h']
re.findall(pattern="o", string="hello") # Finds "o": ['o']
re.findall(pattern=".*o", string="hello") # Finds "hello": ['hello']
re.findall(pattern="h.*", string="hello") # Finds "hello": ['hello']
re.findall(pattern="l", string="hello") # Finds "l" twice: ['l', 'l']


re.split(pattern="h", string="hello") # ['', 'ello']
re.split(pattern="o", string="hello") # ['hell', '']
re.split(pattern=".*o", string="hello") # ['', '']
re.split(pattern="h.*", string="hello") # ['', '']
re.split(pattern="l", string="hello") # ['he', '', 'o']

re.split(pattern="l", string="hello")

re.split(pattern=".*o", string="hello") # Finds "hello": ['hello']

re.findall(pattern="h.*", string="hello") # Finds "hello"

